import { Fragment, useEffect } from "react";
import classes from "./FetchData.module.css";

const FetchData = () => {
    fetch("https://jsonplaceholder.typicode.com/users")
      .then((response) => {
        response.json();
      })
      .then((data) => {
        console.log(data);
      });


  return (
    <Fragment>
      <section className={classes.section}>
        <input type="text" placeholder="Search" className={classes.input} />
      </section>
      <section>
        <table>
          <thead>
            <th>Name</th>
            <th>UserName</th>
            <th>Email</th>
            <th>Mobile Number</th>
          </thead>
        </table>
      </section>
    </Fragment>
  );
};
export default FetchData;
